import React from 'react';

const Header = (props) => {


  return(
    <nav className="navbar">
      <div className="container-fluid">
        <div className="navbar-header">
          <a className="navbar-brand" href="/products">{props.title}</a>
        </div>
        <ul className="nav navbar-nav navbar-right">
          <li className="active"><a href="/search"> <i className="glyphicon glyphicon-search icon"></i>Search</a></li>
          <li ><a href="/offers"><i className="fa fa-percent icon"></i>Offers</a></li>
          <li><a href="help"><i className="fa fa-life-ring icon"></i> Help</a></li>
          <li><a href="/signin"><span className="glyphicon glyphicon-user icon"></span>Sign In</a></li>
          <li><a href="/checkout"><i className="fa fa-cart-plus icon"></i>Cart <span>{props.count}</span> </a></li>

        </ul>
      </div>
    </nav>
  )
}

export default Header;
